import React, { useRef } from 'react';

const Image = () => {
  for (let i = 0;  i++;) {
    const ChipStyles = useRef({
        position: 'absolute',
        top: Math.floor(Math.random()*50),
        left: '50%',
        transform: 'translate(-50%, -50%)'
    });

    return (
      <img src='https://i.imgur.com/Q0InM8M.png' style={ChipStyles.current} alt=""/>
    )}

}

export default Image
